import React, { Component } from 'react';
import classes from './TestUI.module.css';
class TestUI extends Component {
    render() {
        return (

			<div className={classes.pagination}>
				<button className={classes.button} >1</button>
                <div className={classes.downArrow.bounce}>
  <img width="40" height="40" alt="" src="data:image/svg+xml;base64," />
</div>				<button className={classes.button} >2</button>
				<button className={classes.button} >3</button>

			</div>



        );
    };
}

export default TestUI;
